import React from "react";

const Product = ( props ) =>{

    const { title, label } = props

    console.log(label)

    return(<div>
        <div>
            <span>{title}</span>
        </div>
        <div>
            {
                label && label.length > 0 ?
                label.map(el=>
                    {el.id}
                ):''
            }
        </div>
    </div>)
}

export default Product
